import {CREATE_ROOM} from "../actions";

const initialState = {
    room: 99,
    number: 100
}

const createRoomButton = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            state.room++;
            console.log(state)
            return state.room;

        default:
            return state;
    }
}

export default createRoomButton;
